import React from "react";
import { Container, Row, Col, Card } from "react-bootstrap";

const BathroomCleaning = () => {
  return (
    <div
      style={{
        backgroundImage:
          "url('https://images.unsplash.com/photo-1505691938895-1758d7feb511')",
        backgroundSize: "cover",
        backgroundPosition: "center",
        padding: "4rem 0",
      }}
    >
      <Container>
        <Row className="justify-content-start">
          <Col md={6} lg={5}>
            <Card className="shadow border-0 py-4 px-6">
              <h5 className="fw-bold mb-3">Bathroom Cleaning</h5>
              <ul className="mb-0">
                <li>Wash and sanitize the toilet, shower, tub and sink</li>
                <li>Dust all accessible surfaces</li>
                <li>Wipe down all mirrors and glass fixtures</li>
                <li>Clean all floor surfaces</li>
                <li>Take out garbage and recycling</li>
              </ul>
            </Card>
          </Col>
        </Row>
      </Container>
    </div>
  );
};

export default BathroomCleaning;
